tables.table_schema:
CREATE TABLE demographics (
  id UUID PRIMARY KEY,
  age INT,
  gender VARCHAR,
  ethnicity VARCHAR
);

CREATE TABLE urban_planning (
  id UUID PRIMARY KEY,
  city VARCHAR,
  population INT,
  median_income DECIMAL
);

CREATE TABLE income_level (
    id INT PRIMARY KEY,
    category VARCHAR(50),
    min_income DECIMAL,
    max_income DECIMAL
);

CREATE TABLE education_level (
    id INT PRIMARY KEY,
    level VARCHAR(50),
    field_of_study VARCHAR(100),
    institution_name VARCHAR(100)
);

CREATE TABLE employment_status (
    id INT PRIMARY KEY,
    status VARCHAR(50),
    company_name VARCHAR(100),
    job_title VARCHAR(50)
);
